import logo from '../assets/img/logo.png';

const SearchBlock = () => {
  return (
    <section className='searchblock'>
      <logo />
      <h4>Here you'll find all documentation of module's for Roblox created by Michel2003g.</h4>
    </section>
  )
}

export default SearchBlock
